create table member
(
    member_id          bigint auto_increment
        primary key,
    authority          varchar(255) default 'ROLE_NOT_PERMITTED' null,
    email              varchar(255)                              not null,
    nickname           varchar(255)                              not null,
    password           varchar(255)                              not null,
    profile_img_url    varchar(1000)                             null,
    profile_key        varchar(1000)                             null,
    registration_token varchar(255)                              null,
    username           varchar(255)                              not null,
    constraint UK_gc3jmn7c2abyo3wf6syln5t2i
        unique (username),
    constraint UK_hh9kg6jti4n1eoiertn2k6qsc
        unique (nickname),
    constraint UK_mbmcqelty0fbrvxp1q58dn57t
        unique (email)
);

